import React, { useState } from "react";
import { Link } from "react-router-dom";

const Movies = props => {
  return (
    <div className="container pr-5 pl-5">
      <h1 className="text-center">MOVIES GO HERE</h1>
      <div className="row pb-1">
        <div className="input-group col-lg-4">
          <input
            type="text"
            className="form-control"
            placeholder="Search by name"
          />
          <div className="input-group-append">
            <button
              className="btn btn-outline-secondary"
              type="button"
              //Need to add on click event and state event here
            >
              Search
            </button>
          </div>
        </div>
      </div>
      <div className="row pt-5 pb-5">
        <MovieCard props={{"name":"Toy Story","description":"TOYS ALIVE","image":"https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Ftse1.mm.bing.net%2Fth%3Fid%3DOIP.3hjDZEpqqvZeK_oVfbkh-gHaMx%26pid%3DApi&f=1"}}/>
      </div>
    </div>
  );
};

export default Movies;
